    componentDidMount(){
        this.state.authenticated = 'False';
        [this.state.authenticated , this.state.setauthenticated] = this.useState(localStorage.getItem(localStorage.getItem("authenticated")|| false));
        [this.state.username, this.state.setusername] = this.useState("");
        [this.state.password, this.state.setpassword] = this.useState("");   
    }



    render (){
        return (

            <div>
            <p>Welcome Back</p>
            <form onSubmit={this.handleSubmit}>
            <input
            type="text"
            name="Username"
            value={this.username}
            onChange={(e) => this.setusername(e.target.value)}
            />
            <input
            type="password"
            name="Password"
            onChange={(e) => this.setpassword(e.target.value)}
            />
            <input type="submit" value="Submit" />
            </form>
            </div>




        );
    }  
}

export default Login;
